class Solution:
    def shortestBridge(self, grid: List[List[int]]) -> int:
        from collections import deque
        M = len(grid)
        N = len(grid[0])
        ori = [[0, 1], [1, 0], [-1, 0], [0, -1]]
        vis = [[False for _ in range(N)] for _ in range(M)]
        def check(x, y):
            if x<0 or x>=M or y<0 or y>=N:
                return -1
            if grid[x][y] == 0:
                return 0
            elif grid[x][y] == 1:
                return 1
            elif grid[x][y] == 2:
                return 2


        def findisland():
            for i in range(M):
                for j in range(N):
                    if grid[i][j] == 1:
                        return (i, j)

        fir = findisland()
        queue = deque()

        def dfs(x, y):
            grid[x][y] = 2
            for mx, my in ori:
                jud = check(x+mx, y+my)
                if jud == 0:
                    queue.append((x, y, 0))
                    vis[x][y] = True
                if jud == 1:
                    dfs(x+mx, y+my)
            return

        dfs(fir[0],fir[1])
        def bfs():
            while len(queue):
                cur = queue.popleft()
                x, y, cnt = cur[0], cur[1], cur[2]
                for mx, my in ori:
                    nx = x+mx
                    ny = y+my
                    jud = check(nx,ny)
                    if jud == -1:
                        continue
                    if vis[nx][ny]:
                        continue
                    if jud == 0:
                        queue.append((nx, ny, cnt+1))
                        vis[nx][ny] = True
                    elif jud == 1:
                        return cnt

        ans = bfs()
        return ans




